import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';

//Carousel imports
import Carousel from './carousel'
import Dots from './indicator-dots'
import Buttons from './buttons'

import {SearchBar} from './pages/searchbar';
import logo from './images/logo.jpeg';


//Logo
function Logo() {
    return (
        <div className='grow'>
            <img src={logo} className='logo'/>
        </div>
    );
}


//Future implementation
function EvaluationApp() {
    return(
        <div>
            
        </div>
    )
}

//Home Page
class Home extends React.Component {
    constructor () {
        super()
        this.state = {
          axis: 'x'
        }
      }
      render () {
        return (
          <div style={{height: '100%'}}>
            <header>
                <div className='tab'>
                    <button className='tab-button'><Logo className='logo'/></button>
                    <div className='search-bar-div'><SearchBar /></div>
                </div>
            </header>
            <Carousel loop auto axis={this.state.axis} widgets={[Dots, Buttons]} className="custom-class">
              <p className='slide'>Frame 1</p>
              <p className='slide'>FRAME 2</p>
              <p className='slide'>FRAME 3</p>
              <p className='slide'>FRAME 4</p>
            </Carousel>
          </div>
        )
      }
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<Home />);
